import React from "react";
import './OrderCard.css';

const OrderCard = ({ order, orderType }) => {
    return (
        <div className="order-card">
            <div>{order.order_id}</div>
            <div>{order.total}</div>
            <div>{order.order_status}</div>
        </div>
    );
};

export default OrderCard;
